alter session set nls_date_format = 'YYYY-MM-DD HH24:MI:SS';

CREATE TABLE categoria(
    categoria_id INTEGER PRIMARY KEY,
    nombre VARCHAR2(50)
);

--******************************************************************************************************************************

CREATE TABLE estado_habitacion(
    estado_habitacion_id INTEGER PRIMARY KEY,
    estado VARCHAR2(10),
    fecha_inicio DATE,
    fecha_fin DATE
);

--******************************************************************************************************************************

CREATE TABLE habitacion(
    habitacion_id INTEGER PRIMARY KEY,
    categoria_id INTEGER NOT NULL,
    estado_id INTEGER NOT NULL, 
    tarifa FLOAT(12) NOT NULL,
    CONSTRAINT fk_categorias FOREIGN KEY (categoria_id) REFERENCES categoria(categoria_id) ON DELETE CASCADE,
    CONSTRAINT fk_estado FOREIGN KEY (estado_id) REFERENCES estado_habitacion(estado_habitacion_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE clientes(
    cliente_id INTEGER PRIMARY KEY,
    nombre VARCHAR2(50) NOT NULL,
    apellido VARCHAR2(50) NOT NULL,
    telefono VARCHAR2(15) NOT NULL
);

--******************************************************************************************************************************

CREATE TABLE turnos(
    turno_id INTEGER PRIMARY KEY,
    fecha_inicio DATE NOT NULL,
    fecha_fin DATE NOT NULL
);

--******************************************************************************************************************************

CREATE TABLE empleado(
    empleado_id INTEGER PRIMARY KEY,
    nombre VARCHAR2(50) NOT NULL,
    apellido VARCHAR2(50) NOT NULL,
    telefono VARCHAR2(15) NOT NULL,
    direccion VARCHAR2(50) NOT NULL,
    supervisor_id INTEGER,
    turno_id INTEGER,
    salario FLOAT(12) NOT NULL,
    CONSTRAINT fk_turno FOREIGN KEY (turno_id) REFERENCES turnos(turno_id) ON DELETE CASCADE,
    CONSTRAINT fk_supervisor FOREIGN KEY (supervisor_id) REFERENCES empleado(empleado_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE proveedores(
    proveedor_id INTEGER PRIMARY KEY,
    nombre VARCHAR2(50) NOT NULL,
    telefono VARCHAR2(15) NOT NULL,
    direccion VARCHAR2(50) NOT NULL
);

--******************************************************************************************************************************

CREATE TABLE productos(
    producto_id INTEGER PRIMARY KEY,
    nombre VARCHAR2(100) NOT NULL,
    proveedor_id INTEGER NOT NULL,
    precio FLOAT(12) NOT NULL,
    CONSTRAINT fk_proveedor FOREIGN KEY (proveedor_id) REFERENCES proveedores(proveedor_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE servicios(
    servicio_id INTEGER PRIMARY KEY,
    descripcion VARCHAR2(100) NOT NULL,
    precio FLOAT(12) NOT NULL
);

--******************************************************************************************************************************

CREATE TABLE producto_servicio(
   producto_id INTEGER,
   servicio_id INTEGER,
   cant_producto INTEGER NOT NULL,
   CONSTRAINT pk_pisi PRIMARY KEY(producto_id, servicio_id),
   CONSTRAINT fk_productos FOREIGN KEY (producto_id) REFERENCES productos(producto_id) ON DELETE CASCADE,
   CONSTRAINT fk_servicios FOREIGN KEY (servicio_id) REFERENCES servicios(servicio_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE registro_servicio(
    registro_id INTEGER PRIMARY KEY,
    servicio_id INTEGER,
    empleado_id INTEGER,
    cliente_id INTEGER,
    habitacion_id INTEGER,
    fecha DATE NOT NULL,
    CONSTRAINT fk1_servicios FOREIGN KEY (servicio_id) REFERENCES servicios(servicio_id) ON DELETE CASCADE,
    CONSTRAINT fk2_empleados FOREIGN KEY (empleado_id) REFERENCES empleado(empleado_id) ON DELETE CASCADE,
    CONSTRAINT fk3_cliente FOREIGN KEY (cliente_id) REFERENCES clientes(cliente_id) ON DELETE CASCADE,
    CONSTRAINT fk4_habitacion FOREIGN KEY (habitacion_id) REFERENCES habitacion(habitacion_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE estado_reserva(
    estado_reserva_id INTEGER PRIMARY KEY,
    estado VARCHAR2(10) NOT NULL,
    fecha_inicio DATE NOT NULL,
    fecha_fin DATE NOT NULL
);

--******************************************************************************************************************************

CREATE TABLE reserva(
    reserva_id INTEGER PRIMARY KEY,
    estado_id INTEGER,
    empleado_id INTEGER,
    cliente_id INTEGER,
    habitacion_id INTEGER,
    fecha DATE,
    precio FLOAT(12) NOT NULL,
    CONSTRAINT fk1_estado FOREIGN KEY (estado_id) REFERENCES estado_reserva(estado_reserva_id) ON DELETE CASCADE,
    CONSTRAINT fk3_empleados FOREIGN KEY (empleado_id) REFERENCES empleado(empleado_id) ON DELETE CASCADE,
    CONSTRAINT fk4_clientes FOREIGN KEY (cliente_id) REFERENCES clientes(cliente_id) ON DELETE CASCADE,
    CONSTRAINT fk5_habitacion FOREIGN KEY (habitacion_id) REFERENCES habitacion(habitacion_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE pagos(
    pago_id INTEGER PRIMARY KEY,
    cliente_id INTEGER,
    fecha DATE,
    precio FLOAT(12) NOT NULL,
    CONSTRAINT fk_cliente FOREIGN KEY (cliente_id) REFERENCES clientes(cliente_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE factura(
    factura_id INTEGER PRIMARY KEY,
    cliente_id INTEGER,
    pago_id INTEGER,
    empleado_id INTEGER,
    fecha DATE,
    CONSTRAINT fk1_cliente FOREIGN KEY (cliente_id) REFERENCES clientes(cliente_id) ON DELETE CASCADE,
    CONSTRAINT fk2_pago FOREIGN KEY (pago_id) REFERENCES pagos(pago_id) ON DELETE CASCADE,
    CONSTRAINT fk4_empleados FOREIGN KEY (empleado_id) REFERENCES empleado(empleado_id) ON DELETE CASCADE
);

--******************************************************************************************************************************

CREATE TABLE detalles_factura(
    factura_id INTEGER,
    reserva_id INTEGER,
    registro_id INTEGER,
    CONSTRAINT fk1_factura FOREIGN KEY (factura_id) REFERENCES factura(factura_id) ON DELETE CASCADE,
    CONSTRAINT fk_reserva FOREIGN KEY (reserva_id) REFERENCES reserva(reserva_id) ON DELETE CASCADE,
    CONSTRAINT fk_registro FOREIGN KEY (registro_id) REFERENCES registro_servicio(registro_id) ON DELETE CASCADE
);


